import React from 'react';

const ContributorList = (contributor) => (
    <div className = "ContributorList">
        <div>
            <div className="Contributor-Name">
                {contributor.name}
            </div>
        </div>
        <div>
            {contributor.description}
        </div>
    </div>
);

export default ContributorList
